import React from 'react';
import { BrowserRouter, Routes, Route } from 'react-router-dom'

// 라우트 기반 코드 분할
const EdgeMenu = React.lazy(() => import('page/edg/EdgeMenu').then((mod) => ({ default: mod.EdgeMenu })))


function App() {
  const name = 'Alex Lee';
  const element = <h1>hello, {name}</h1>
  return element
}

export default App;
